    private final CampaignLevelFactory campaignLevelFactory;


    public LevelPackOne(CampaignLevelFactory campaignLevelFactory) {
        this.campaignLevelFactory = campaignLevelFactory;
    }


    boolean check() {
        int index = campaignLevelFactory.index;

        if (GameRules.slayRules) return false;

        if (index > 70 && index <= 80) {
            LoadingParameters instance = LoadingParameters.getInstance();
            instance.loadingType = LoadingType.campaign_custom_legacy;
            campaignLevelFactory.gameController.gameSaver.legacyImportManager.applyFullLevel(instance, getLevelFromPackOne());
            instance.campaignLevelIndex = index;
            instance.slayRules = false; // these levels are forcing normal rules
            instance.colorOffset = campaignLevelFactory.readColorOffsetFromHolder(instance.fractionsQuantity);
            LoadingManager.getInstance().startGame(instance);
            return true;
        }

        return false;
    }


